import React from 'react';

function TaskList({ tasks }) {
  return (
    <ul className="taskList">
      {tasks.map((task, index) => (
        <li key={index}>
          <span className={`taskCategory ${task.category}`}>
            {task.category}
          </span>
          {task.text}
        </li>
      ))}
    </ul>
  );
}

export default TaskList;
